import{_ as e,c as o,o as i,ah as n}from"./chunks/framework.PvdZnrZd.js";const c=JSON.parse('{"title":"SHIPPIT SHIPPING","description":"SHIPPIT SHIPPING","frontmatter":{"title":"SHIPPIT SHIPPING","description":"SHIPPIT SHIPPING","date":"2025-07-18T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/shipping/shippit-shipping.md","filePath":"zenith/featured-app/shipping/shippit-shipping.md"}'),p={name:"zenith/featured-app/shipping/shippit-shipping.md"};function a(r,t,l,s,h,g){return i(),o("div",null,[...t[0]||(t[0]=[n('<p><a href="/zenith/introduction/">Multi-Vendor Marketplace for Shopify</a> is now Integrated with another shipping add-on: <strong>Shippit</strong></p><h2 id="what-is-shippit-shipping" tabindex="-1">What is Shippit Shipping? <a class="header-anchor" href="#what-is-shippit-shipping" aria-label="Permalink to &quot;What is Shippit Shipping?&quot;">​</a></h2><p><a href="https://www.shippit.com/" target="_blank" rel="noreferrer">Shippit</a> is a web-based, multi-carrier shipping solution for e-commerce retailers. Designed to streamline the fulfillment process.</p><p>This feature will allow you to ship your goods via multiple carrier shipping methods. Moreover, you can automatically generate shipping labels.</p><p><strong>NOTE</strong>:</p><p>The <strong>Shippit</strong> feature app is available only with the Multivendor <strong>Pro</strong> <strong>Plan</strong> ($60/month). Moreover, you need to enable the <a href="/zenith/featured-app/overview.html"><strong>Shipping</strong></a> add-on (free) from the ‘feature apps’ section of the app.</p><p>Above all, access to Shipping requires your Shopify store to be on the plan that supports <strong>Real-Time Carrier-Calculated Shipping</strong>.</p><p>Also, you can enable only one shipping method within Shippit to calculate the shipping rates.</p><p><strong>CHARGES</strong>:</p><p>This feature will have an additional charge of <strong>USD 10 per month</strong> over &amp; above your current Multivendor Marketplace plan.</p><p>SHIPPIT SHIPPING FEATURE APP IS AVAILABLE <strong>BOTH FOR RATE CALCULATION &amp; FULFILLMENT</strong>.</p><h2 id="installation" tabindex="-1">Installation <a class="header-anchor" href="#installation" aria-label="Permalink to &quot;Installation&quot;">​</a></h2><p>The admin needs to visit the <strong>Multi-vendor Marketplace Admin panel</strong> &gt; click on the <strong>three dots</strong> &gt; and click on the <strong>feature apps</strong>. Further, <strong>enable</strong> the <strong>Shippit</strong> feature app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/tesss.webp" alt="Enable Shipping"></p><p>Furthermore, agree &amp; approve the charges:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/testttt-2.webp" alt="Shippit  Shipping payment"></p><h2 id="configuration-admin-end" tabindex="-1">Configuration: Admin End <a class="header-anchor" href="#configuration-admin-end" aria-label="Permalink to &quot;Configuration: Admin End&quot;">​</a></h2><p>Firstly, the Admin needs to enable this shipping method from the shipping configuration. So, for this, visit:</p><p><strong>Multivendor Marketplace admin panel</strong> &gt; <strong>Configuration</strong> &gt; <strong>Shipping Methods configuration</strong>.</p><p>Click on the <strong>three dots</strong> under the <strong>Action</strong> menu &amp; further, click on <strong>Enable</strong>.</p><p><strong>Note</strong>: Kindly choose only those shipping services that you need. Don’t keep all the services selected otherwise it creates a delay in retrieving shipping rates at the storefront.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/testaa-1200x485.webp" alt="Shipping method configuration"></p><p>Moving on, the admin needs to configure the Shippit shipping method.</p><p>So, for this, either click on <strong>Configure Shipping</strong> or go to <strong>Multi vendor marketplace admin panel</strong> &gt; <strong>configuration</strong> &gt; <strong>Shippit Configuration</strong></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/test2.webp" alt="Shippit Shipping"></p><h2 id="configure-shippit" tabindex="-1">Configure Shippit <a class="header-anchor" href="#configure-shippit" aria-label="Permalink to &quot;Configure Shippit&quot;">​</a></h2><p>On the following page, configure the following details:</p><ul><li><p><strong>Sandbox Mode:</strong> If you want to test the functionality of this shipping method, keep the sandbox mode enabled. Remember, shipping labels won’t be generated in testing mode.</p></li><li><p><strong>Extra Shipping Charge Enable:</strong> If you want to charge an additional shipping amount from the customer, you can configure it as either a percentage or a fixed amount.</p><ul><li><strong>Extra Shipping Charge Type:</strong> Here you can select the percentage or a fixed amount from the dropdown.</li><li><strong>Extra Shipping Charge:</strong> You can now enter the as either a percentage or a fixed amount.</li></ul></li><li><p><strong>Allow Seller to configure their own Shippit account:</strong> In case, if you want your seller to configure their own Shippit account then, you can let sellers add their details &amp; fulfill them instead of yourself adding the details.</p></li><li><p><strong>Shippit Access Token:</strong> If the above config is disabled then Admin can enter their Shippit Access Token provided by the Shippit and configure their account.</p></li><li><p><strong>Shipping label cost is borne by:</strong> Choose who will bear the shipping label charges, the admin, or the seller. (This is an extra cost apart from what the customer has paid.)</p></li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/testab-1200x665.webp" alt="Shippit Configuration"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/testabc-1.webp" alt="Shippit Configuration"></p><h2 id="configuration-seller-end" tabindex="-1">Configuration: Seller End <a class="header-anchor" href="#configuration-seller-end" aria-label="Permalink to &quot;Configuration: Seller End&quot;">​</a></h2><p>Further, the Seller can configure Shippit from his/her panel.</p><p>Go to <strong>Multi vendor Marketplace Seller panel</strong> &gt; <strong>Configuration</strong> &gt; <strong>Shipping Methods configuration</strong>&gt; <strong>Enable</strong> the Shippit shipping:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/testabcd-1200x657.webp" alt="Seller shipping method config"></p><p>Furthermore, the seller can set the shipping method as <strong>by-default</strong>, so that every single product created by him will have <strong>Shippit</strong> as the <strong>default shipping method</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/testtabc-1200x657.webp" alt="Set as Default Shipping"></p><h3 id="in-case-the-admin-has-allowed-the-sellers-to-add-their-details" tabindex="-1">In case the Admin has allowed the sellers to add their details: <a class="header-anchor" href="#in-case-the-admin-has-allowed-the-sellers-to-add-their-details" aria-label="Permalink to &quot;In case the Admin has allowed the sellers to add their details:&quot;">​</a></h3><p>For this Admin will have to enable the &quot;Allow Seller to Configure their own Shippit Account&quot; from the Shippit configuration on the Admin Panel.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/testttab-1200x613.webp" alt="Seller Shippit config"></p><p>Once enabled the seller will have the Shippit Configuration option under the Configuration Menu on the Seller panel.</p><p>Here, the seller can set up their Shippit account by entering the Shippit Api Key provided By Shippit.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/tesas-1200x613.webp" alt="Shipping API Key"></p><h2 id="set-default-shipping-method-for-products" tabindex="-1">Set Default Shipping Method For Products <a class="header-anchor" href="#set-default-shipping-method-for-products" aria-label="Permalink to &quot;Set Default Shipping Method For Products&quot;">​</a></h2><ul><li><p>For all products (old and new)</p></li><li><p>Only for new products</p></li><li><p>For products that don’t have any shipping method on</p></li></ul><p>If not this, the seller can set the shipping method on individual products while adding/editing them.</p><p>So, go to Multi-vendor Marketplace Seller panel &gt; Products &gt;Product Listing &gt; Add/Edit the Product:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/testacb-1200x613.webp" alt="Shipping method on product edit page"></p><p><strong>Important Points to Note:</strong></p><p>Configuring the global settings is crucial, as the system automatically uses the global configuration if a product&#39;s dimensions are not provided.</p><p>So, for this click on the Global Configuration menu:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/testth.webp" alt="Global config"></p><p>So, from here, the seller can do the Global configuration:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/testtr.webp" alt="Global config"></p><p><strong>NOTE</strong>: It is mandatory to add product weight while creating one.</p><p>Additionally, kindly mark the Required Shipping mandatory for all the products, if not marked for any product then the shipping will not the applied to that specific product.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/tets-1200x559.webp" alt="Required Shipping"></p><h2 id="shopify-store-frontend" tabindex="-1">Shopify Store Frontend <a class="header-anchor" href="#shopify-store-frontend" aria-label="Permalink to &quot;Shopify Store Frontend&quot;">​</a></h2><p>The customers will have the option to choose a shipping method based on the configurations set in the backend after providing their information.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/checkout-4.webp" alt="Checkout page"></p><h4 id="admin-end-order-detail-page" tabindex="-1">Admin End Order detail page: <a class="header-anchor" href="#admin-end-order-detail-page" aria-label="Permalink to &quot;Admin End Order detail page:&quot;">​</a></h4><p>The admin can also check his or her shipping charges commission applied above the shipping charge as per the configuration done by the Admin in the Shippit configuration.</p><p>For this, Go to Admin Panel &gt; Orders &gt; Order Listing &gt; Now view the order.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/ysb.webp" alt="Admin shipping comission"></p><h2 id="order-fulfillment" tabindex="-1">Order Fulfillment: <a class="header-anchor" href="#order-fulfillment" aria-label="Permalink to &quot;Order Fulfillment:&quot;">​</a></h2><p>Once the order is placed, the seller will be fulfilling the order on the seller panel, and selecting the Shippit shipping as the fulfillment method.</p><p>Go to <strong>Seller panel</strong> &gt; <strong>Orders</strong> &gt; <strong>Order Listing</strong> &gt; <strong>View</strong> (under <strong>Action</strong>). Select the method of order fulfillment as <strong>Shippit</strong> and fulfill the order.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/ytes.webp" alt="Order Fulfillment by SHippit"></p><p><em>Note: The rates shown during order fulfillment changes and appear differently in the Shippit dashboard after the order is placed.</em></p><h3 id="shipping-label-generation-and-manifest-print" tabindex="-1">Shipping Label Generation and Manifest Print <a class="header-anchor" href="#shipping-label-generation-and-manifest-print" aria-label="Permalink to &quot;Shipping Label Generation and Manifest Print&quot;">​</a></h3><p>Once the order is fulfilled the seller will be able to see the Tracking URL and Tracking number on the order detail page.</p><p>Also, Sellers will have the option to generate the shipping label from their seller panel. Also, shipping labels can only be generated for <strong>fulfilled orders</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/rtest.webp" alt="Order detail page"></p><p>Now, If the seller wants to download the Shipping label then click on Actions &gt; Print Shipping Label:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/oihf-1.webp" alt="Shipping label"></p><p>Additionally, It is the same for the print Manifest, click on Actions &gt; Print Manifest:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/12/jkl-3.webp" alt="Manifest report"></p>',76)])])}const u=e(p,[["render",a]]);export{c as __pageData,u as default};
